import React from 'react';

import { CardStyle3} from '../../../xamin';

class   Index extends React.Component {
    constructor(props) {
        super(props);
        this.state={
           cardData:[
                {
                    img:"./static/assets/images/facybox/5-1.png",
                    value:50,
                    heading:"Tranding Volumn"
                },
                {
                    img:"./static/assets/images/facybox/5-2.png",
                    value:50,
                    heading:"Tranding Volumn"
                },

                {
                    img:"./static/assets/images/facybox/5-3.png",
                    value:50,
                    heading:"Tranding Volumn"
                },
                {
                    img:"./static/assets/images/facybox/5-4.png",
                    value:50,
                    heading:"Tranding Volumn"
                },
           ],
            checkList:[
                "Social Sharing",
                "Boost SEO ranking",
                "Marketing",
                "Retention",
                "Visual Reviews",
                "Reviews Generation"
            ],
        }
    }

    render() {
        let { cardData,checkList } = this.state;
        return (
            <>
                <section className="pt-0">
                  <div className="container">
                      <div className="row">
                      { cardData.map((item, index) => (
                              <div className="col-md-3 col-sm-6">
                                    <CardStyle3
                                        img ={item.img}
                                        value={item.value}
                                        heading={item.heading}
                                        mainClass="iq-timer style2 mb-5  mb-md-0 mb-lg-0   text-center"
                                    >
                                    <span class="timer dark-timer" data-to="50" data-speed="2000">{item.value}</span>
                                    <span class="timer_postfix dark-timer">M+</span><i class="fa fa-percent" aria-hidden="true"></i>
                                    <p class="dark-timer">{item.heading}</p>
                                    </CardStyle3>
                                </div>
                              )) }
                      </div>

                  </div>
                </section>
            </>
        );
    }
}

export default Index;
